import { ReactPropTypes } from "react";
const Button = ({ color, text }) => {
  const onClick = () => {
    console.log("click");
  };
  return (
    <button
      onClick={onClick}
      style={{ backgroundColor: color }}
      className="btn"
    >
      {text}
    </button>
  );
};

Button.defaultProps = {
  color: "blue",
};

Button.ReactPropTypes = {
  text: ReactPropTypes.string,
  color: ReactPropTypes.string,
};
export default Button;
